import { NavLink, Outlet } from "react-router-dom";
const HLayout = () => {
    return (
        <section>
            <h1>Hi</h1>
            <nav>
                <h1>This is Home Page</h1>
                <NavLink to="contact">Contact</NavLink>
                <NavLink to="faq">FAQ</NavLink>
            </nav>
            <Outlet /> 
        </section>
    );
}

export default HomeLayout;
